    <title>Logo ENSIBS</title>
<style>

#rayon-1, #rayon-2, #scanner, .cls-15, .cls-16 {
    transform-origin: center center;
}

.cls-4 {
    fill: #ccc;
    /* fill:#d7d7d7 */
}

.cls-15, .cls-16 {
    display: none;
}

#bg {
}

#cible {
    display: none;
}

#rayon-1, #circle10375, #circle10369, #circle10367, #circle10365 {
    animation: loop 13s linear infinite reverse;
}

#rayon-2, #circle10363, #circle10371, #circle10373 {
    animation: loop 19s linear infinite;
}

#scanner {
    opacity: 0.5;
    animation: loop 7s linear infinite;
}

#path8522, #path674, #path10850, #path2898, #path3082, #path550, #path6166, #path10386, #path10730, #path9126, #path706 {
    animation: scanned 7s linear infinite;
}

#path8522 {
    animation-delay: 1700ms;
}

#path9126 {
    animation-delay: 1200ms;
}

#path6166 {
    animation-delay: 2100ms;
}

#path3082 {
    animation-delay: 2300ms;
}

#path2898 {
    animation-delay: 3200ms;
}

#path10850 {
    animation-delay: 4600ms;
}

#path10730 {
    animation-delay: 4900ms;
}

#path550 {
    animation-delay: 5300ms;
}

#path674 {
    animation-delay: 5600ms;
}

#path10386 {
    animation-delay: 5800ms;
}

#path706 {
    animation-delay: 5900ms;
}

#lighting {
    display: none;
}

@keyframes loop {
    from {
        transform: rotate(0);
    }
    to {
        transform: rotate(360deg);
    }
}

@keyframes scanned {
    0% {
        fill: red;
    }
    60% {
        fill: #d18181;
    }
    100% {
        fill: #ccc;
    }
}

html, body {
    width: 100%;
    height: 100%;
    margin: 0;
}

body {
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #2d3436;
}


</style>
